public boolean equals(Object o) {
  if (this == o) {
    return true;
  }
  if (o == null || getClass() != o.getClass()) {
    return false;
  }
  Login that = (Login) o;
  return Objects.equals(user, that.user) &&
      Objects.equals(password, that.password);
}
